import React,{useState, useEffect} from 'react'
import aps from '../services/axios.js';
import axios from 'axios'
import Recordlayout from './Recordlayout'

const Printmenu = () => {
    const [items,setItems] = useState([])
    const [use, setUse] = useState('')
    const pritamFunc = async ()=>{
        const res = await aps.pritamFuncMe()
        console.log('present USER exists');
        console.log(res.data) ;
        setUse(res.data._id);
    }
    const loadData = async ()=>{
        const res = await aps.getTemplates()
        setItems(res.data)
    }
    useEffect(() => {
        loadData()
        .then((res)=>{
            console.log('load data success')
        })
    },[]) 
    return (
        <div>
            <div>                
            {
                items.map(item => (            
                    <div key={item._id}>
                        <Recordlayout dataid={item._id} userid={item.userId} name={item.name}/>
                    </div>
                ))
            }   
        </div>
       </div>
    )
}

export default Printmenu
